[01:44:46] LOG.error: SQLSTATE[23000]: Integrity constraint violation: 1048 Column 'image' cannot be null (Connection: mysql, SQL: insert into `blogs` (`blog_category_id`, `author_name`, `title`, `content`, `image`, `updated_at`, `created_at`) values (1, Muhammad Ashar, Medicine is the science[1] and managing the diagnosis, prognosis, <p><span style="color: rgb(32, 33, 34);">Medicine has been practiced since&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Prehistoric_medicine" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">prehistoric times</a><span style="color: rgb(32, 33, 34);">, and for most of this time it was an&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Art" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">art</a><span style="color: rgb(32, 33, 34);">&nbsp;(an area of creativity and skill), frequently having connections to the&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Religion" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">religious</a><span style="color: rgb(32, 33, 34);">&nbsp;and&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Philosophy" rel="noopener noreferrer" target="_blank" style="color: rgb(255, 255, 102); background-color: rgb(161, 0, 0);">philosophical</a><span style="color: rgb(32, 33, 34);">&nbsp;beliefs of local culture. For example, a&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Medicine_man" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">medicine man</a><span style="color: rgb(32, 33, 34);">&nbsp;would apply&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Herbs" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">herbs</a><span style="color: rgb(32, 33, 34);">&nbsp;and say&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Prayer" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">prayers</a><span style="color: rgb(32, 33, 34);">&nbsp;for healing, or an ancient&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Philosopher" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">philosopher</a><span style="color: rgb(32, 33, 34);">&nbsp;and&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Physician" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">physician</a><span style="color: rgb(32, 33, 34);">&nbsp;would apply&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Bloodletting" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">bloodletting</a><span style="color: rgb(32, 33, 34);">&nbsp;according to the theories of&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Humorism" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">humorism</a><span style="color: rgb(32, 33, 34);">. In recent centuries, since the&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/History_of_science" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">advent of modern science</a><span style="color: rgb(32, 33, 34);">, most medicine has become a combination of art and science (both&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Fundamental_science" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">basic</a><span style="color: rgb(32, 33, 34);">&nbsp;and&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Applied_science" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">applied</a><span style="color: rgb(32, 33, 34);">, under the&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Umbrella_term" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">umbrella</a><span style="color: rgb(32, 33, 34);">&nbsp;of&nbsp;</span><strong style="color: rgb(32, 33, 34);">medical science</strong><span style="color: rgb(32, 33, 34);">). For example, while stitching technique for&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Surgical_suture" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">sutures</a><span style="color: rgb(32, 33, 34);">&nbsp;is an art learned through practice, knowledge of what happens at the&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Cytology" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">cellular</a><span style="color: rgb(32, 33, 34);">&nbsp;and&nbsp;</span><a href="https://en.m.wikipedia.org/wiki/Molecular_medicine" rel="noopener noreferrer" target="_blank" style="color: rgb(51, 102, 204);">molecular</a><span style="color: rgb(32, 33, 34);">&nbsp;level in the tissues being stitched arises through science.</span></p><p><br></p><h1><span style="color: rgb(32, 33, 34);">Etymology</span></h1><p><br></p><p><br></p><iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://www.youtube.com/embed/BB2-oj0EO6o?showinfo=0"></iframe><p><br></p><p>Prescientific forms of medicine, now known as traditional medicine or folk medicine, remain commonly used in the absence of scientific medicine and are thus called alternative medicine. Alternative treatments outside of scientific medicine with safety and efficacy concerns are termed quackery.</p>, ?, 2023-07-12 01:44:46, 2023-07-12 01:44:46)) {
    "userId": 1,
    "exception": {
        "errorInfo": [
            "23000",
            1048,
            "Column 'image' cannot be null"
        ],
        "connectionName": "mysql"
    }
}

